import React from 'react';
import '../sidebar/sidebar.css'

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Mi Sidebar</h2>
      <ul>
        <li><a>Dogs</a></li>
        <li><a href="">My Dogs</a></li>
        <li><a href="#">Favorites</a></li>
      </ul>
    </div>
  );
}

export default Sidebar;
